        title: 'Apa itu cawan menstruasi?',
        content:
          'Sebuah cawan menstruasi (menstrual cup) adalah sebuah cawan yang fleksibel, berbentuk seperti lonceng yang fungsinya mengumpulkan darah menstruasi.',
